import React, { Component } from 'react';

var map;

class Map extends Component {

  componentDidMount() {
    map = new window.google.maps.Map(document.querySelector('#map'), {
      zoom: 4,
      centerDef: {lat: 40.758745, lng: -73.952642 },
    });

    map.data.loadGeoJson('https://Users/phb/desktop/beaconave/edit-boundaries/edit-boundaries/nycneighborhoods.geojson');
  }
  render() {
    return (
      <div className="map-wrapper">
        <div id="map">
        </div>
      </div>
    );
  }
}

export default Map;
